<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Артемьева Фаина Тимофеевна родится пятнадцатого января 2061. <br><p>Двадцать пятого октября 2834 устроится на работу в Фонд на должность контента-менеджера. </p><p>	Окончательно уволится одиннадцатого января 2436. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
